import React, { Component } from 'react';
import Slider from '../Slider';
require ('../../js/sliders.js');

class Home extends Component{
   
    render(){
        return(
            <div className="sliderHome">
                <Slider></Slider>
            </div>
        );
    }
}
export default Home;
